import axios from 'axios';


export default function idCheck(id) {
    alert(id);
    axios(
        {
            url: '/user/idCheck',
            method: 'get',
            params:{userId:id},
            baseURL: 'http://localhost:8888',
            withCredentials: true,
        }
    ).then(function(resource) {
        if(resource.data.equals('true'))
         alert(resource.data);
    });
}
